var defaultBankruptcyConfig = {
    searchUrl: 'http://bankrot.fedresurs.ru/DebtorsSearch.aspx',
    defaultForm: _.extend({}, fedresursBankruptcyDefaultForm, {}),
    defaultHeaders: _.extend({}, fedresursBankruptcyDefaultHeaders, {}),
    messages: {
        baseUrl: 'http://bankrot.fedresurs.ru'
    },
    emptyResponseData: {
        messages: {
            total: 0
        }
    }
};

var bankruptcyConfig = {
    'company': _.extend({}, defaultBankruptcyConfig, {
        formFormat: {
            'ogrn': function(form, params) {
                return _.extend({}, form, {
                    'ctl00$cphBody$OrganizationCode1$CodeTextBox': params.ogrn,
                    'ctl00$cphBody$rblDebtorType': 'Organizations'
                });
            }
        },
        headersFormat: {
            'ogrn': function(headers, params) {
                return _.extend({}, headers, {
                    // Cookie template '...debtorsearch=typeofsearch=Organizations...&orgogrn=...'
                    'Cookie': headers['Cookie']
                        .replace(/debtorsearch=typeofsearch=/, 'debtorsearch=typeofsearch=Organizations')
                        .replace(/orgogrn=/, 'orgogrn=' + params.ogrn)
                });
            }
        }
    }),
    'individual': _.extend({}, defaultBankruptcyConfig, {
        formFormat: {
            'inn': function(form, params) {
                return _.extend({}, form, {
                    'ctl00$cphBody$PersonCode1$CodeTextBox': params.inn,
                    'ctl00$cphBody$rblDebtorType': 'Persons',
                });
            },
            'name': function(form, params) {
                var name = expandName(params.name);
                return _.extend({}, form, {
                    'ctl00$cphBody$tbPrsLastName': name.last,
                    'ctl00$cphBody$tbPrsFirstName': name.first,
                    'ctl00$cphBody$tbPrsMiddleName': name.middle,
                    'ctl00$cphBody$rblDebtorType': 'Persons'
                });
            }
        },
        headersFormat: {
            'inn': function(headers, params) {
                return _.extend({}, headers, {
                    // Cookie template '...debtorsearch=typeofsearch=Persons...&prsinn=...'
                    'Cookie': headers['Cookie']
                        .replace(/debtorsearch=typeofsearch=/, 'debtorsearch=typeofsearch=Persons')
                        .replace(/prsinn=/, 'prsinn=' + params.inn)
                });
            },
            'name': function(headers, params) {
                var name = expandName(params.name);
                return _.extend({}, headers, {
                    // Cookie template '...debtorsearch=typeofsearch=Persons...&prslastname=...&prsfirstname=...&prsmiddlename=...'
                    'Cookie': headers['Cookie']
                        .replace(/debtorsearch=typeofsearch=/, 'debtorsearch=typeofsearch=Persons')
                        .replace(/prslastname=/, 'prslastname=' + (name.last || ''))
                        .replace(/prsfirstname=/, 'prsfirstname=' + (name.first || ''))
                        .replace(/prsmiddlename=/, 'prsmiddlename=' + (name.middle || ''))
                });
            }
        }
    })
};

function expandName(name) {
    var w = name.split(' ');

    return {
        last: w[0],
        first: w[1],
        middle: w[2]
    };
}

function doBankruptcy(req, success, error, config, form, headers, parseServiceFormHtml, parseListHtml, parseMessagesHtml) {
    var searchUrl = config.searchUrl;

    fetchSearch();

    function fetchSearch() {
        request.get({
            url: searchUrl,
        }, function(err, httpResponse, body) {
            if (err) {
                error(util.format('GET %s failed...\n%s', searchUrl, err));
                return;
            }

            var serviceFormData = parseServiceFormHtml(body, fedresursBankruptcyServiceFormParamNames);

            _.extend(form, serviceFormData);

            search();
        });
    }

    function search() {
        request.post({
            url: searchUrl,
            form: form,
            headers: headers
        }, function(err, httpResponse, body) {
            if (err) {
                error(util.format('POST %s with data %j failed...\n%s', searchUrl, form, err));
                return;
            }

            var listData = parseListHtml(body),
                listSize = _.size(listData.list);

            if (listData.error === 'REQUEST_BLOCKING') {
                error(util.format('REQUEST_BLOCKING: POST %s; params: %s', searchUrl, JSON.stringify(req.params)));
            } else if (listSize === 1) {
                fetchMessages(listData.list[0]);
            } else {
                success(config.emptyResponseData);
            }
        });
    }

    function fetchMessages(listItem) {
        var baseUrl = config.messages.baseUrl,
            itemUrl = baseUrl + listItem.link;

        request.get({
            url: itemUrl,
        }, function(err, httpResponse, body) {
            if (err) {
                error(util.format('GET %s failed...\n%s', itemUrl, err));
                return;
            }

            var data = parseMessagesHtml(body, {
                baseUrl: baseUrl
            });

            success(data);
        });
    }
}


// req: {
//     params: {
//         ogrn: (String)
//     }
// }
exports.getCompanyBankruptcy = function(req, success, error) {
    var config  = bankruptcyConfig['company'],
        form    = config.formFormat['ogrn'](config.defaultForm, req.params),
        headers = config.headersFormat['ogrn'](config.defaultHeaders, req.params);

    doBankruptcy(req, success, error, config, form, headers, parser.parseServiceFormHtml, parser.parseListHtml, parser.parseMessagesHtml);
};

// req: {
//     params: {
//         inn: inn,
//         name: name
//     }
// }
exports.getIndividualBankruptcy = function(req, success, error) {
    var paramName = (req.params.inn && 'inn') || (req.params.name && 'name');

    var config  = bankruptcyConfig['individual'],
        form    = config.formFormat[paramName](config.defaultForm, req.params),
        headers = config.headersFormat[paramName](config.defaultHeaders, req.params);

    doBankruptcy(req, success, error, config, form, headers, parser.parseServiceFormHtml, parser.parseListHtml, parser.parseMessagesHtml);
};
